import computador from "../../assets/desktop-and-mobile.png"
import { Grafismo } from "./styles";
const Dashboard = () => {



    return(
        <>
        <Header/>
        <Grafismo>
            <div>
                <h1>Solução DynaPredict</h1>
            </div>
            <div>
                <img></img>
            </div>
            <img src={computador}></img>
        </Grafismo>
        </>
    )
};
export default Dashboard;
